import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import './Mobile.css'; // New mobile-friendly styles

// Components
import Header from './components/Header';
import Footer from './components/Footer';

// Original Pages
import Login from './pages/Login';
import Register from './pages/Register';
import Onboarding from './pages/Onboarding';
import Dashboard from './pages/Dashboard';
import Profile from './pages/Profile';

// New Mobile-Friendly Pages
import DashboardNew from './pages/DashboardNew';
import ProfileNew from './pages/ProfileNew';
import RanchNew from './pages/RanchNew';

// Herd Pages
import HerdsList from './pages/herds/HerdsList';
import AddHerd from './pages/herds/AddHerd';
import EditHerd from './pages/herds/EditHerd';
import HerdDetail from './pages/herds/HerdDetail';

// Milk Production Pages
import MilkProductionList from './pages/milk/MilkProductionList';
import AddMilkProduction from './pages/milk/AddMilkProduction';
import EditMilkProduction from './pages/milk/EditMilkProduction';

// Auth Context
import { useAuth } from './contexts/AuthContext';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { currentUser, loading } = useAuth();

  if (loading) {
    return <div className="container">Loading...</div>;
  }

  if (!currentUser) {
    return <Navigate to="/login" />;
  }

  return children;
};

function App() {
  return (
    <div className="app">
      {/* We'll conditionally render the Header based on whether it's a desktop or mobile view */}
      {/* For mobile design we'll not use the Header and Footer components */}
      <Routes>
        {/* Public Routes - Login/Register can be used for both desktop and mobile */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Mobile Routes - new UI design */}
        <Route 
          path="/dashboard" 
          element={
            <ProtectedRoute>
              <DashboardNew />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/profile" 
          element={
            <ProtectedRoute>
              <ProfileNew />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/herds" 
          element={
            <ProtectedRoute>
              <RanchNew />
            </ProtectedRoute>
          } 
        />

        {/* Protected Routes - Other pages still use the old design */}
        <Route 
          path="/onboarding" 
          element={
            <ProtectedRoute>
              <Onboarding />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/herds/add" 
          element={
            <ProtectedRoute>
              <Header />
              <AddHerd />
              <Footer />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/herds/edit/:id" 
          element={
            <ProtectedRoute>
              <Header />
              <EditHerd />
              <Footer />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/herds/:id" 
          element={
            <ProtectedRoute>
              <Header />
              <HerdDetail />
              <Footer />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/milk-production" 
          element={
            <ProtectedRoute>
              <Header />
              <MilkProductionList />
              <Footer />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/milk-production/add" 
          element={
            <ProtectedRoute>
              <Header />
              <AddMilkProduction />
              <Footer />
            </ProtectedRoute>
          } 
        />

        <Route 
          path="/milk-production/edit/:id" 
          element={
            <ProtectedRoute>
              <Header />
              <EditMilkProduction />
              <Footer />
            </ProtectedRoute>
          } 
        />

        {/* Default Route */}
        <Route path="/" element={<Navigate to="/dashboard" />} />
      </Routes>
    </div>
  );
}

export default App;
